import React from 'react';
import styled from 'styled-components';
import EnrollListItem from './EnrollListItem';

const EnrollArea = styled.div`
    background-color: #fff;
    width: 1200px;   
    height: 800px;
    border-radius: 2px;
    box-shadow: 0px 5px 10px 1px #0004;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 30px;
`;

const EnrollTable = styled.table`
    width: 100%;
    border-radius: 10px;
`;

const EnrollTableHead = styled.thead`
    background-color: #aaf;
    color: #fff;
    font-weight: normal;
`

const EnrollTableTr = styled.tr`
    border-bottom: 1px solid #ccd;
    height: 30px;
    padding: 7px 3px;
`;

const EnrollList = () => {
    return (
        <EnrollArea>
            <EnrollTable>
                <colgroup>
                    <col style={{ width: "70px" }}/>
                    <col/>
                    <col style={{ width: "110px" }}/>
                    <col style={{ width: "100px" }}/>
                    <col style={{ width: "80px" }}/>
                    <col style={{ width: "70px" }}/>
                    <col style={{ width: "70px" }}/>
                </colgroup>
                <EnrollTableHead>
                    <EnrollTableTr>
                        <th>#</th>
                        <th>제목</th>
                        <th>개설자</th>
                        <th>개설일</th>
                        <th>마감일</th>
                        <th>상태</th>
                        <th>조회</th>
                    </EnrollTableTr>
                </EnrollTableHead>
                <tbody>
                    <EnrollListItem />
                </tbody>
            </EnrollTable>
        </EnrollArea>
    );
};

export default EnrollList;
